
<!DOCTYPE html>
<html>
<head>
    <title>Inkscape Output</title>
</head>
<body>
    <canvas id='canvas' width='210' height='297'></canvas>
    <script>
    var ctx = document.getElementById("canvas").getContext("2d");
    	
// #layer1
	
// #text4499
	ctx.lineWidth = 0.070004;
	ctx.fillStyle = 'rgb(0, 0, 0)';
	ctx.font = "normal normal 10.58333302px sans-serif";
	ctx.fillText("test", 25.702381, 85.333328);
	
// #rect4559
	ctx.beginPath();
	ctx.lineWidth = 0.070004;
	ctx.fillStyle = 'rgb(15, 255, 255)';
	ctx.rect(7.559524, 53.583332, 85.422623, 71.059525);
	ctx.fill();
	
// #path4563
	ctx.beginPath();
	ctx.lineJoin = 'miter';
	ctx.strokeStyle = 'rgb(0, 0, 0)';
	ctx.lineCap = 'butt';
	ctx.miterLimit = 4;
	ctx.lineWidth = 0.672042;
	ctx.moveTo(56.696427, 140.517850);
	ctx.bezierCurveTo(58.208333, 183.607140, 56.696427, 194.190470, 56.696427, 194.190470);
	ctx.stroke();
	
// #rect4849
	ctx.beginPath();
	ctx.fillStyle = 'rgb(1, 1, 1)';
	ctx.miterLimit = 4;
	ctx.lineWidth = 0.070115;
	ctx.rect(29.482143, 209.309520, 83.910713, 42.333332);
	ctx.fill();
	
// #text4853
	ctx.lineWidth = 0.070004;
	ctx.fillStyle = 'rgb(0, 0, 0)';
	ctx.font = "normal normal 10.58333302px sans-serif";
	ctx.fillText("A", 32.505951, 79.285713);
	
// #text4857
	ctx.lineWidth = 0.070004;
	ctx.fillStyle = 'rgb(0, 0, 0)';
	ctx.font = "normal normal 10.58333302px sans-serif";
	ctx.fillText("b", 67.279762, 228.208340);
	ctx.fillText("None", 67.279762, 241.437520);

    </script>
</body>
</html>
